import CommentBox from "./CommentBox.js";

function FetchCommentBox(comments) {
  var lists = [];
  for (i in comments) {
    lists.push(<CommentBox isReadOnly={true} content={comments[i].contents}></CommentBox>);
  }

  return lists;
}
